  `craftTypeName` varchar(128) CHARACTER SET utf8mb4  NOT NULL DEFAULT '',
  `airlineName` varchar(128) CHARACTER SET utf8mb4 NOT NULL DEFAULT '',
  `departureAirport` varchar(128) CHARACTER SET utf8mb4 DEFAULT '',
  `departureCity` varchar(128) CHARACTER SET utf8mb4  NOT NULL DEFAULT '',
  `departureTerminal` varchar(64) CHARACTER SET utf8mb4 DEFAULT '',
  `arrivalAirport` varchar(128) CHARACTER SET utf8mb4  DEFAULT '',
  `arrivalCity` varchar(128) CHARACTER SET utf8mb4  NOT NULL DEFAULT '',
  `arrivalTerminal` varchar(64) CHARACTER SET utf8mb4 DEFAULT '',
  `departureDate` datetime DEFAULT NULL,
  `arrivalDate` datetime DEFAULT NULL,
  `cabins` varchar(2048) CHARACTER SET utf8mb4 DEFAULT '',
  `lowestPrice` int(11) DEFAULT NULL,
  `dayTime` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=150 DEFAULT CHARSET=utf8mb4;

